function handleSubmit(e) {
    alert('The value is: ' + this.input.value);
    e.preventDefault();
}

const SignIn = () => {
    return (
        <form onSubmit={handleSubmit}>
            <label>
                Name:
                <input type="text" ref={(input) => this.input = input} />
            </label>
            <input type="submit" value="Submit" />
        </form>
    );
};

export default SignIn;
